import { Navbar, Nav, NavItem} from 'react-bootstrap';
import { Link } from 'react-router-dom';

class CustomNavbar extends Component {
  render() {
    return (
      <Navbar default collapseOnSelect>
      </Navbar>
    )
  }
}

export default CustomNavbar;
